	std::cout << "Najwieksza liczba wynosi " << maxLiczba << ", a najmniejsza wynosi " << minLiczba << std::endl;

	std::cout << "Liczby w zapisie binarnym:\n";
	for (const auto& x : wektorLiczb) {
